class Solution(object):
    def dailyTemperatureEfficient(self, temperatures):
        """
        initialize result_stack to have same length with temperature array (all zeroes)
        stack = [[temp1, index1], [temp2, index2]...]
        for each item in temperature, add to stack the currTempIndex and currTemp; 
                while stack is not empty and currTemp > the temp of the item at top of stack i.e stack[-1][0]
                        result_stack[stackIndex] = currIndex - stackIndex
        
        """
        result = [0] * len(temperatures)
        stack = []
        for i, t in enumerate(temperatures):
            while stack and t > stack[-1][0]:
                stackTemp, stackIndex = stack.pop()
                result[stackIndex] = i - stackIndex
            
            stack.append([t, i])
        return result


    def dailyTemperatures(self, temperatures):
        """
        :type temperatures: List[int]
        :rtype: List[int]

        ====

        Given an array of integers temperatures represents the daily temperatures, return an array answer such that answer[i] is the number of days you have to wait after the ith day to get a warmer temperature. If there is no future day for which this is possible, keep answer[i] == 0 instead.
        Example 1:
        Input: temperatures = [73,74,75,71,69,72,76,73]
        Output: [1,1,4,2,1,1,0,0]
        Example 2:

        Input: temperatures = [30,40,50,60]
        Output: [1,1,1,0]

        Solution
        answer = []
        for each item in temperatures, 
        create while loop that starts from currIndex+1 to end of originalList, to check if there exist a temp_number that is greater than item
                if temp_number > item, add index to answer. then reset index to itemIndex then break
                else increase index, continue

        """

        # edge case 1
        unique = set(temperatures)
        if len(unique) == 1:
            return [0] * len(temperatures)

        answer = []
        index = 0
        for item in range(len(temperatures)):
            temp_item = temperatures[item]
            index = item+1
            check = 1
            
            #edge case 2
            while index < len(temperatures):
                if temperatures[index] > temp_item:
                    answer.append(check)
                    break
                elif index == len(temperatures)-1 and temperatures[index] <= temperatures[item]:
                    answer.append(0)
                    index +=1
                    check +=1
                    continue
                else:
                    index+=1
                    check+=1
                    continue
       
        # because the last number will always be 0
        answer.append(0) 
        print(f"ans: {len(answer)} and temp: {len(temperatures)}")
        return answer
    

